import React from 'react';
import video from '../../videos/video.mp4';
import { HeroContainer,
    HeroBg,
    VideoBg,
    HeroContent, HeroH1, HeroP, HeroBtnWrapper, Button, ArrowForward, ArrowRight} from './HeroElements';

const HeroSection = () => {
    return (
        <HeroContainer>
            <HeroBg>
                <VideoBg autoPlay loop muted src={video} type='video/mp4' />
            </HeroBg>
            <HeroContent>
                <HeroH1>Welcome to My Website</HeroH1>
                <HeroP>
                    Read about my projects and experiences here.
                </HeroP>
                <HeroBtnWrapper>
                    <Button to="projects">
                        Read More {hover ? <ArrowForward /> : <ArrowRight />}
                    </Button>
                </HeroBtnWrapper>
            </HeroContent>
        </HeroContainer>
    )
}

export default HeroSection
